import React from 'react'

const Navbar = () => {
  return (
    <section className='Hero-section'>
      <div style={{backgroundImage: 'url("./images/yellow-bg.png")', 
backgroundSize: 'cover', backgroundRepeat: 'none', height: "120vh"}}>
      </div>
    </section>
  )
}

export default Navbar
